import React from 'react';
import Carousel from 'nuka-carousel';

export default class Slide extends React.Component {
  render() {
    return (
      <Carousel>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSsMHoScvUYgZKDGriLL6z87eNyZSxoKGmhQNYc3itwBmqrYcuR" />
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfkbNEsy7WNYhSwi3J47dHvdsFHmTYI-5PcalfbFJhRzARdg_myw" />
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQw_b9pBineNx9SEGih9tjBl8rr_O-W3rM5vSShM8UzDIVuizm-yg" />
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSd6iXhm4NkLQ_2guuL_jkeHsNSKpVTPExBA6yVZqp5wqF8jJhJUw" />
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTMjjJ2PkzLxT7bxqkhes13aagEgEs2J4_DmDH6RxU0QdkJpbKz" />
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfHp9OlmTowaHQ8EBfJfts3ej57Wjo2bB7jY-GexPIpHeb6GP9" />
      </Carousel>

    );
  }
}
